import React from "react";

export default function Intrestpage() {
  return (
    <>
      <div>
        <h1 className="font-mono">Which are you most Intrested in ?</h1>
        <p>Choose just one. This will help us get you started (but won't limit your exprience).</p>
      </div>
    </>
  );
}
